import {FETCH_REPORT_BY_PLAYER_ID} from './actionType'
import axios from 'axios'


export const fetchReportByPlayerId = (id) => dispatch => {
    const url = 'http://localhost:3001/api/v1/reports/players/'+id;
    axios.get(url)
        .then(res =>
            dispatch({
                type: FETCH_REPORT_BY_PLAYER_ID,
                payload: res.data
            })
        );   
};
